INSERT INTO `paper3` VALUES ('007', '单选题', '如何为特种车辆让路?', '向左减速让路，直到紧急车辆过去', '向右减速让路，直到紧急车辆过去', '立即停车，即使你在交叉口也是如此', '向前车鸣喇叭，自己在特种车辆前开路', 'B', '《道路交通安全法》第五十三条：警车、消防车、救护车、工程救险车执行紧急任务时，可以使用警报器、标志灯具；在确保安全的前提下，不受行驶路线、行驶方向、行驶速度和信号灯的限制，其他车辆和行人应当让行。警车、消防车、救护车、工程救险车非执行紧急任务时，不得使用警报器、标志灯具，不享有前款规定的道路优先通行权。让路的都是靠右边，并且是减速的。');
INSERT INTO `paper3` VALUES ('031', '判断题', '驾驶机动车驶出环岛时，应先驶入最右侧车道不用开启转向灯驶离即可。', '', '', '', '', 'B', '驶出环岛，需要先开启右转向灯。');
INSERT INTO `paper3` VALUES ('034', '判断题', '驾驶机动车在山区冰雪道路上行驶，遇到前车正在爬坡时，后车应选择适当地点停车，等前车通过后再爬坡。', '', '', '', '', 'A', '驾驶机动车在山区冰雪道路上行驶，遇到前车正在爬坡时，后车应选择适当地点停车，等前车通过后再爬坡，后车应远离前车，避免前车打滑后退相撞。');
INSERT INTO `paper3` VALUES ('035', '判断题', ' 驾驶机动车遇到骑自行车人占道影响通行时，可连续鸣喇叭加速从其左侧绕行。', '', '', '', '', 'B', '遇到这种情况应当减速慢行，必要时避让。因此本题错误。');
INSERT INTO `paper3` VALUES ('038', '判断题', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应持续鸣喇叭催促。', '', '', '', '', 'B', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应注意观察车况，合理超车。');
INSERT INTO `paper3` VALUES ('041', '判断题', '变更车道前确认后方无来车时可以不开转向灯变道。', '', '', '', '', 'B', '变更车道时要提前开启转向灯，养成良好的开车习惯，防患于未然，因此本题错误。');
INSERT INTO `paper3` VALUES ('057', '判断题', '机动车倒车时，后方道路条件较好的，应加速倒车，迅速完成操作。', '', '', '', '', 'B', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题错误。');
INSERT INTO `paper3` VALUES ('066', '多选题', '机动车在夜间发生故障时，驾驶人要做什么以确保安全？', '选择安全区域停车', '开启危险报警闪光灯', '开启示廓灯和后位灯', '按规定设置警告标志', 'ABCD', '《道路交通安全法实施条例》第六十条：机动车在道路上发生故障或者发生交通事故，妨碍交通又难以移动的，应当按照规定开启危险报警闪光灯并在车后50米至100米处设置警告标志，夜间还应当同时开启示廓灯和后位灯。');
INSERT INTO `paper3` VALUES ('067', '多选题', ' 驾驶机动车在山区道路上坡路段接近坡顶时，超车存在风险，以下说法正确的是什么？', '接近坡顶时视线受阻，无法观察坡顶之后道路走向', '接近坡顶时视线受阻，无法观察对向来车情况', '接近坡顶时车速较慢', '接近坡顶时视线受阻，无法观察坡顶之后是否有障碍物', 'ABD', '驾驶机动车在山区道路上坡路段接近坡顶时，接近坡顶时视线受阻需要注意：观察坡顶之后道路走向；观察对向来车情况；观察坡顶之后是否有障碍物。');
INSERT INTO `paper3` VALUES ('092', '多选题', '唐某驾驶一辆大客车，乘载74人（核载30人），以每小时38公里的速度，行至一连续下陡坡转弯路段时，机动车翻入路侧溪水内，造成17人死亡、57人受伤。唐某的主要违法行为是什么？', '酒后驾驶', '客车超员', '疲劳驾驶', '超速行驶', 'BD', '违法行为：1、乘载74人(核载30人)所以客车超员。2、弯道限速30公里/每小时，所以超速行驶。');
INSERT INTO `paper3` VALUES ('107', '单选题', '驾驶机动车在山区道路因故障停车需要注意什么？', '选择下坡路段停放', '选择上坡路段停放', '选择平缓路段停放', '选择坡顶位置停放', 'C', '停车时要尽可能选择安全的地点停车，而不管是上坡路、下坡路或是坡顶都有可能让所停车辆发生溜车。');
INSERT INTO `paper3` VALUES ('108', '单选题', '在冰雪路面制动时，发现车辆偏离方向，以下说法正确的是？', '连续轻踩轻放刹车', '用力踩刹车', '停止踩刹车', '以上说法都不对', 'C', '这个情况下，立即踏制动踏板容易引起侧翻。如后轮一直被刹住的情况下，不松开踏板，汽车会出现方向驶去控制。正确的做法是先握紧方向盘，不要紧急踩刹车。');
INSERT INTO `paper3` VALUES ('109', '单选题', '雨天机动车在高速公路行驶发生“水滑”现象时怎样处置？', '急踏制动踏板减速', '缓抬加速踏板减速', '迅速转向进行调整', '提速增大车轮排水量', 'B', '所谓“水滑”现象就是雨天汽车在积水路面上高速行驶时，轮胎与路面间的存水不能排除，水的压力使轮胎上浮，形成汽车在积水路面上滑行的现象。选项ACD都有可能造成车辆侧滑等事故的发生，而通过缓抬加速踏板的方式减速才能真正让车渐渐减慢。');
INSERT INTO `paper3` VALUES ('113', '单选题', '如何为特种车辆让路?', '向左减速让路，直到紧急车辆过去', '向右减速让路，直到紧急车辆过去', '立即停车，即使你在交叉口也是如此', '向前车鸣喇叭，自己在特种车辆前开路', 'B', '《道路交通安全法》第五十三条：警车、消防车、救护车、工程救险车执行紧急任务时，可以使用警报器、标志灯具；在确保安全的前提下，不受行驶路线、行驶方向、行驶速度和信号灯的限制，其他车辆和行人应当让行。警车、消防车、救护车、工程救险车非执行紧急任务时，不得使用警报器、标志灯具，不享有前款规定的道路优先通行权。让路的都是靠右边，并且是减速的。');
INSERT INTO `paper3` VALUES ('116', '单选题', ' 如图所示，驾驶机动车遇到这种主路左侧来车的情况，以下说法正确的是什么？', '左侧来车应该给己车让行', '己车应该给左侧来车让行', '不需让行，谁车速快谁先过', '不需让行，己车有优先通行权', 'B', '图中路考为辅路近主路，此时己车应该给左侧来车让行。');
INSERT INTO `paper3` VALUES ('119', '单选题', '出车前对轮胎进行哪些方面的检查？', '什么也不用检查', '轮胎有没有清洗', '备胎在什么位置', '轮胎的紧固和气压', 'D', '对轮胎的检查是为了确保在行车过程中能安全行驶，由此本题应选“轮胎的紧固和气压”。');
INSERT INTO `paper3` VALUES ('120', '单选题', '使用已有裂纹或损伤的轮胎容易引起什么后果？', '向一侧偏驶', '爆胎', '转向困难', '行驶阻力增大', 'B', '使用已有裂纹或损伤的轮胎容易引起“爆胎”的后果。');
INSERT INTO `paper3` VALUES ('126', '单选题', '驾乘人员下车时要怎样做以保证安全？', '停车后立即开门下车', '观察前方交通情况', '先开车门再观察侧后情况', '先观察侧后情况，再缓开车门', 'D', '切记安全第一，所以先观察侧后情况，再缓开车门。');
INSERT INTO `paper3` VALUES ('130', '单选题', '夜间机动车通过照明条件良好的路段时，要怎样使用灯光', '前后雾灯', '近光灯', '远光灯', '危险报警闪光灯', 'B', '用近光灯不会照得对方看不见路，同时为了安全起见，开启近光灯能够让相互间清晰可见。');
INSERT INTO `paper3` VALUES ('132', '单选题', '如果轮胎胎侧顺线出现裂口，以下做法正确的是什么?', '放气减压', '及时换胎', '给轮胎充气', '不用更换', 'B', '出现裂口.肯定需要更换，以免爆胎。');
INSERT INTO `paper3` VALUES ('141', '单选题', '驾驶机动车驶出小区上道路行驶，以下做法正确的是什么？', '、无需观察直接汇入主路车流', '无需避让主路车辆', '在不妨碍主路车辆正常行驶的前提下汇入车流', '鸣喇叭示意主路车避让', 'C', '驾驶机动车驶出小区上道路行驶，要注意在不妨碍主路车辆正常行驶的前提下汇入车流。');
INSERT INTO `paper3` VALUES ('147', '判断题', '车辆在泥泞路段发生侧滑时，要向车尾侧滑方向缓打方向盘修正', '', '', '', '', 'A', '这题可以这么理解，后轮发生侧滑，当然要向侧滑的一侧转动转向轮来使前轮与之对应，否则不就原地打转了嘛。');
INSERT INTO `paper3` VALUES ('152', '判断题', '驾驶机动车驶出环岛时，应先驶入最右侧车道不用开启转向灯驶离即可。', '', '', '', '', 'B', '驶出环岛，需要先开启右转向灯。');
INSERT INTO `paper3` VALUES ('153', '判断题', '腐蚀品着火时，不能用水柱直接喷射扑救。', '', '', '', '', 'A', '无机腐蚀品或有机腐蚀品直接燃烧时，除具有与水反应特性的物质外，一般可用大量的水扑救。但宜用雾状水，不能用高压水柱直接喷射物品，以免飞溅的水珠带上腐蚀品灼伤灭火人员。');
INSERT INTO `paper3` VALUES ('154', '判断题', '下坡路制动失效后，在不得已的情况下，可用车身侧面擦撞山坡，迫使机动车减速停车。', '', '', '', '', 'A', '刹车突然失灵时，摩擦力特别能显神奇功效。可用车前保险杠、车厢等钢性部位与路边岩石、大树或土坡摩擦、碰撞，在不威胁乘车人安全的情况下强行停车。这样，虽对车会造成损害，但是命更重要，就别心疼车了。因此本题正确。');
INSERT INTO `paper3` VALUES ('155', '判断题', '驾驶机动车在山区冰雪道路上行驶，遇到前车正在爬坡时，后车应选择适当地点停车，等前车通过后再爬坡。', '', '', '', '', 'A', '驾驶机动车在山区冰雪道路上行驶，遇到前车正在爬坡时，后车应选择适当地点停车，等前车通过后再爬坡，后车应远离前车，避免前车打滑后退相撞。');
INSERT INTO `paper3` VALUES ('159', '判断题', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应持续鸣喇叭催促。', '', '', '', '', 'B', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应注意观察车况，合理超车。');
INSERT INTO `paper3` VALUES ('160', '判断题', '驾驶机动车应尽量骑轧可跨越车道分界线行驶，便于根据前方道路情况选择车道。', '', '', '', '', 'B', '根据《中华人民共和国道路交通安全法实施条例》第八十二条：机动车在高速公路上行驶，不得有下列行为：（一）倒车、逆行、穿越中央分隔带掉头或者在车道内停车；（二）在匝道、加速车道或者减速车道上超车；（三）骑、轧车行道分界线或者在路肩上行驶；（四）非紧急情况时在应急车道行驶或者停车；（五）试车或者学习驾驶机动车。');
INSERT INTO `paper3` VALUES ('168', '判断题', '安全头枕要调整到与颈部平齐的高度', '', '', '', '', 'B', '如果后方有车辆撞击，头部由于惯性会后冲，没有头枕保护，颈椎有可能折断。所以头枕的中心一定要与头齐平。');
INSERT INTO `paper3` VALUES ('171', '判断题', '驾驶机动车汇入车流时不能影响其他机动车通行。', '', '', '', '', 'A', '汇入车流的前提是不能影响其他车辆的正常通行，因此本题正确。');
INSERT INTO `paper3` VALUES ('172', '判断题', ' 驾驶机动车从辅路汇入主路车流时要迅速。', '', '', '', '', 'B', '驾车要谨慎，不要那么“迅速”！注意是汇入车流，所以正确的做法是要减速慢行，在不影响其他车辆正常行驶的情况下汇入主路。');
INSERT INTO `paper3` VALUES ('175', '判断题', '道路划设专用车道的，在专用车道内，其他机动车可以借道超车。', '', '', '', '', 'B', '专用车道指的是“机动车道、非机动车道、人行道”这些都属于专用车道，什么车走什么道，应该就不能借道超车，否则有可能开到人行道上去借道超车！');
INSERT INTO `paper3` VALUES ('179', '判断题', '机动车不得在隧道中倒车。', '', '', '', '', 'A', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题正确。');
INSERT INTO `paper3` VALUES ('199', '多选题', '李某驾驶一辆大客车，乘载21人（核载35人），行驶途中察觉制动装置有异常但未处理，行至双岛海湾大桥时时速为50公里（该路段限速40公里），因制动失灵坠入海中，造成13人死亡、8人受伤。李某的主要违法行为是什么？', '超速行驶', '疲劳驾驶', '客车超员', '驾驶具有安全隐患的机动车', 'AD', '违法行为：1、察觉制动装置有异常但未处理，所以为驾驶故障机动车。2、行至双岛海湾大桥时时速为50公里(该路段限速40公里)所以为超速行驶。此题注意核载35人就是规定可以做35个人，实际乘坐21人所以没有客车超员。');
INSERT INTO `paper3` VALUES ('200', '多选题', ' 吴某驾驶一辆大客车，乘载33人（核载22人），行至163县道7公里加300米处时，机动车失控坠入山沟，造成10人死亡、21人受伤。事后经酒精检测，吴某血液酒精含量为26毫克/百毫升。吴某的主要违法行为是什么？', '超速行驶', '客车超员', '疲劳驾驶', '酒后驾驶', 'BD', '违法行为：1、乘载33人(核载22人)，所以客车超员；2、吴某血液酒精含量为26毫克/百毫升，所以酒后驾驶。（此处既然检测到酒精就算酒后驾驶，不然人的血液里边哪里会有酒精）');
INSERT INTO `paper3` VALUES ('255', '单选题', '检查机动车机油时，以下做法正确是什么?', '停在平坦的地方，在启动前检查', '停在平坦的地方，在怠速状态下检查', '无需停在平坦的地方，在启动前检查', '无需停在平坦的地方，在怠速状态下检查', 'A', '对的检查的方式是需要注意检查的条件.千万不要在汽车发动的时候去检查。检查的时候要把车先停好，然后拉紧手刹，再取出机油尺，先族干净后放进去，然后再重新拿出来检查机油油位。如果在机油尺下端的标记之间.就表示了油且是正常的。如果在标记下面，就表示机油留太少。机油太多的话就会出现在机油最在标记上面。如果少了就需要适里添加机油。');
INSERT INTO `paper3` VALUES ('267', '单选题', '机动车在狭窄的坡路会车时，正确的会车方法是什么？', '下坡车让上坡车', '坡顶交会时距离坡顶远的一方让行', '上坡车让下坡车', '下坡车已行至中途而上坡车未上坡时，让上坡车', 'A', '《道路交通安全法实施条例》第四十八条：在狭窄的坡路，上坡的一方先行；但下坡的一方已行至中途而上坡的一方未上坡时，下坡的一方先行。图中下坡的车已经到了中途，可以先行。');
INSERT INTO `paper3` VALUES ('277', '单选题', ' 驾驶机动车从高速公路加速车道汇入行车道车流时，以下做法正确的是什么?', '从正常行驶车辆后驶入行车道', '从正常行驶车辆前驶入行车道', '停车等待正常行驶车辆通过', '加速直接驶入行车道', 'A', '加速车道指的是供车辆驶入高速车流之前加速用的车道。从正常行驶车辆后驶入行车道。');
INSERT INTO `paper3` VALUES ('279', '单选题', '关于驾驶机动车汇入主路车流，以下说法正确的是什么?', '不得妨碍主路车辆正常行驶', '不得妨碍主路车辆正常行驶', '可以碾压实线及导流线', '不得妨碍主路车辆正常行驶。', 'A', '不得妨碍主路车辆正常行驶。');
INSERT INTO `paper3` VALUES ('285', '单选题', '驾驶机动车遇到前方车辆停车，等待行人通过人行横道时，以下做法正确的是什么？', '从左侧超越前车', '鸣喇叭催促前车向前行驶', '从右侧超越前车', '与前车保持安全距离,排队等待', 'D', '前车等待行人过道时，自己也应耐心等待，B做法不恰当，AC做法易引发交通事故。');
INSERT INTO `paper3` VALUES ('289', '单选题', '超车过程中，被超车辆突然加速怎么办？', '加速迅速超越', '加速迅速超越', '持续鸣喇叭超越', '持续鸣喇叭超越', 'C', '超车过程中，被超车辆突然加速，应该减速放弃超车，否则容易引发事故。');
INSERT INTO `paper3` VALUES ('297', '判断题', '下坡路制动失效后，在不得已的情况下，可用车身侧面擦撞山坡，迫使机动车减速停车。', '', '', '', '', 'A', '刹车突然失灵时，摩擦力特别能显神奇功效。可用车前保险杠、车厢等钢性部位与路边岩石、大树或土坡摩擦、碰撞，在不威胁乘车人安全的情况下强行停车。这样，虽对车会造成损害，但是命更重要，就别心疼车了。因此本题正确。');
INSERT INTO `paper3` VALUES ('310', '判断题', ' 机动车在路边起步后，应随时注意机动车两侧道路情况，向左缓慢转向，逐渐驶入正常行驶道路。', '', '', '', '', 'A', ' 机动车在路边起步后，应随时注意机动车两侧道路情况，向左缓慢转向，逐渐驶入正常行驶道路。');
INSERT INTO `paper3` VALUES ('314', '判断题', '驾驶机动车汇入车流时不能影响其他机动车通行。', '', '', '', '', 'A', '汇入车流的前提是不能影响其他车辆的正常通行，因此本题正确。');
INSERT INTO `paper3` VALUES ('315', '判断题', ' 驾驶机动车从辅路汇入主路车流时要迅速。', '', '', '', '', 'B', '驾车要谨慎，不要那么“迅速”！注意是汇入车流，所以正确的做法是要减速慢行，在不影响其他车辆正常行驶的情况下汇入主路。');
INSERT INTO `paper3` VALUES ('316', '判断题', '预计在超车过程中与对面来车有会车可能时，应提前加速超越。', '', '', '', '', 'B', '预计在超车过程中与对面来车有会车可能时，应当放弃超车。若加速超越，有可能会引起不必要的事故。');
INSERT INTO `paper3` VALUES ('318', '判断题', '道路划设专用车道的，在专用车道内，其他机动车可以借道超车。', '', '', '', '', 'B', '专用车道指的是“机动车道、非机动车道、人行道”这些都属于专用车道，什么车走什么道，应该就不能借道超车，否则有可能开到人行道上去借道超车！');
INSERT INTO `paper3` VALUES ('319', '判断题', '驾驶人下车前要观察后视镜和侧头观察左后侧情况。', '', '', '', '', 'A', '侧头观看左后侧情况是防止在开车门时，撞到非机动车驾驶人。在确定左后方无人经过，再开车门！侧头是把头转动一下，看看左后视镜，并不是把头探出车外。因此本题正确。');
INSERT INTO `paper3` VALUES ('323', '判断题', '夜间驾驶机动车在照明条件良好的路段可以不使用灯光', '', '', '', '', 'B', '用近光灯不会照得对方看不见路，同时为了安全起见，开启近光灯能够让相互间清晰可见。因此本题错误。');
INSERT INTO `paper3` VALUES ('326', '判断题', '在道路上行车时，安全跟车距离无需随着速度变化而变化。', '', '', '', '', 'B', '安全跟车距离【需要】随着速度变化而变化，车速越高，跟车的安全距离要随之增大，这样才能保证安全。因此本题错误。');
INSERT INTO `paper4` VALUES ('009', '单选题', '停车时，以下做法正确的是？', '在交叉路口停车', '在铁道路口停车', '在停车泊位外停车', '在停车场内停车', 'D', '在交叉路口、隧道、桥梁、立交桥上、公交车站、消防栓、铁路与公路交叉口及人行道上不能临时停车和停放车辆。');
INSERT INTO `paper4` VALUES ('019', '单选题', '超车时，发现前方机动车正在超车，驾驶人怎么办？', '紧跟其后，伺机超越', '加速强行超越', '连续鸣喇叭催前车让路', '停止超车，让前方机动车先超车', 'D', '若强行超车，很有可能发生危险。只有在前车完成超车后，才能看清前方道路的状况，此时超车也才较为安全。');
INSERT INTO `paper4` VALUES ('026', '判断题', '车辆在泥泞路段发生侧滑时，要向车尾侧滑方向缓打方向盘修正', '', '', '', '', 'A', '这题可以这么理解，后轮发生侧滑，当然要向侧滑的一侧转动转向轮来使前轮与之对应，否则不就原地打转了嘛。');
INSERT INTO `paper4` VALUES ('029', '判断题', ' 驾驶机动车在高速公路上行驶，能见度小于50米时，只要车速不超过20公里/小时，可以不驶离高速公路。', '', '', '', '', 'B', '在高速公路上，能见度小于50米时，开启雾灯、近光灯、示廓灯、前后位灯和危险报警闪光灯，车速不得超过每小时20公里，并从最近的出口尽快驶离高速公路。');
INSERT INTO `paper4` VALUES ('036', '判断题', '为防止有害气体中毒伤员继续中毒，首先将伤员转移到空气新鲜的地方。', '', '', '', '', 'A', '中毒伤员所处的空间肯定空气不流通，空气新鲜的地方可以让人体的呼吸管道起畅通的作用。因此应当先转移位置到空气新鲜的地方。因此本题正确。');
INSERT INTO `paper4` VALUES ('037', '判断题', '在高速公路上，遇尾随较近行驶的机动车时，可以选择时机迅速从中间插入。', '', '', '', '', 'B', '这种情况下若是从中间插入，很有可能与前后车辆发生擦碰或是追尾，因此不可行。所以本题错误。');
INSERT INTO `paper4` VALUES ('040', '判断题', '同方向有三条机动车道的路段，校车在右侧车道停靠上、下学生时，校车停靠车道后方和相邻机动车道上的机动车应停车等待。', '', '', '', '', 'A', '根据规定，校车在同方向只有一条机动车道的道路上停靠时，后方车辆应当停车等待，不得超越。校车在同方向有两条以上机动车道的道路上停靠时，校车停靠车道后方和相邻机动车道上的机动车应当停车等待，其他机动车道上的机动车应当减速通过。');
INSERT INTO `paper4` VALUES ('048', '判断题', '驾驶汽车在雨天起步前要使用刮水器', '', '', '', '', 'A', '驾驶汽车在雨天起步前要使用刮水器，增加视线区域。');
INSERT INTO `paper4` VALUES ('051', '判断题', ' 驾驶机动车从辅路汇入主路车流时要迅速。', '', '', '', '', 'B', '驾车要谨慎，不要那么“迅速”！注意是汇入车流，所以正确的做法是要减速慢行，在不影响其他车辆正常行驶的情况下汇入主路。');
INSERT INTO `paper4` VALUES ('054', '判断题', '道路划设专用车道的，在专用车道内，其他机动车可以借道超车。', '', '', '', '', 'B', '专用车道指的是“机动车道、非机动车道、人行道”这些都属于专用车道，什么车走什么道，应该就不能借道超车，否则有可能开到人行道上去借道超车！');
INSERT INTO `paper4` VALUES ('055', '判断题', '驾驶人下车前要观察后视镜和侧头观察左后侧情况。', '', '', '', '', 'A', '侧头观看左后侧情况是防止在开车门时，撞到非机动车驾驶人。在确定左后方无人经过，再开车门！侧头是把头转动一下，看看左后视镜，并不是把头探出车外。因此本题正确。');
INSERT INTO `paper4` VALUES ('058', '判断题', '机动车不得在隧道中倒车。', '', '', '', '', 'A', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题正确。');
INSERT INTO `paper4` VALUES ('063', '判断题', '行车中变更车道不需要提前开启转向灯', '', '', '', '', 'B', '变更车道一定要【提前】开启转向灯。');
INSERT INTO `paper4` VALUES ('064', '判断题', '机动车遇有急弯路时要在进入弯路后减速。', '', '', '', '', 'B', '遇到急弯路应当提前减速慢行，等到进入弯路后减速很容易发生侧滑或侧翻。因此本题错误');
INSERT INTO `paper4` VALUES ('068', '多选题', ' 驾驶机动车通过学校门口时应注意什么?', '注意观察标志标线', '注意减速慢行', '不要鸣喇叭', '快速通过', 'ABC', '车辆通过学校和小区应注葱观察标志标线.低速行驶，不要鸣喇叭，减少噪音，以免影响学生学习。');
INSERT INTO `paper4` VALUES ('084', '多选题', '杨某驾驶改装小型客车（核载9人，实载64人，其中62人为幼儿园学生），行至榆林子镇马槽沟村处，占用对向车道逆行时与一辆重型自卸货车正面碰撞，造成22人死亡、44人受伤。该起事故中的主要违法行为是什么？', '货车超速行驶', '非法改装机动车', '客车超员', '客车逆向行驶', 'BCD', '违法行为：1、改装小型客车，所以非法改装机动车；2、核载9人，实载64人，所以客车超员；3、占用对向车道逆行时，所以客车逆向行驶。');
INSERT INTO `paper4` VALUES ('091', '多选题', '某日19时，杨某驾驶大客车，乘载57人（核载55人），连续行驶至次日凌晨1时,在金城江区境内050国道3008公里加110米处，因机动车左前胎爆裂，造成12人死亡、22人受伤的特大交通事故。杨某的主要违法行为是什么？', '疲劳驾驶', '客车超员', '超速行驶', '操作不当', 'AB', '违法行为：1、题目提到连续行驶到次日凌晨1时，属疲劳驾驶。2、题目提到只能做55以上，却坐了57人，属客车超员。');
INSERT INTO `paper4` VALUES ('107', '单选题', '驾驶机动车在山区道路因故障停车需要注意什么？', '选择下坡路段停放', '选择上坡路段停放', '选择平缓路段停放', '选择坡顶位置停放', 'C', '停车时要尽可能选择安全的地点停车，而不管是上坡路、下坡路或是坡顶都有可能让所停车辆发生溜车。');
INSERT INTO `paper4` VALUES ('108', '单选题', '在冰雪路面制动时，发现车辆偏离方向，以下说法正确的是？', '连续轻踩轻放刹车', '用力踩刹车', '停止踩刹车', '以上说法都不对', 'C', '这个情况下，立即踏制动踏板容易引起侧翻。如后轮一直被刹住的情况下，不松开踏板，汽车会出现方向驶去控制。正确的做法是先握紧方向盘，不要紧急踩刹车。');
INSERT INTO `paper4` VALUES ('113', '单选题', '如何为特种车辆让路?', '向左减速让路，直到紧急车辆过去', '向右减速让路，直到紧急车辆过去', '立即停车，即使你在交叉口也是如此', '向前车鸣喇叭，自己在特种车辆前开路', 'B', '《道路交通安全法》第五十三条：警车、消防车、救护车、工程救险车执行紧急任务时，可以使用警报器、标志灯具；在确保安全的前提下，不受行驶路线、行驶方向、行驶速度和信号灯的限制，其他车辆和行人应当让行。警车、消防车、救护车、工程救险车非执行紧急任务时，不得使用警报器、标志灯具，不享有前款规定的道路优先通行权。让路的都是靠右边，并且是减速的。');
INSERT INTO `paper4` VALUES ('116', '单选题', ' 如图所示，驾驶机动车遇到这种主路左侧来车的情况，以下说法正确的是什么？', '左侧来车应该给己车让行', '己车应该给左侧来车让行', '不需让行，谁车速快谁先过', '不需让行，己车有优先通行权', 'B', '图中路考为辅路近主路，此时己车应该给左侧来车让行。');
INSERT INTO `paper4` VALUES ('131', '单选题', '机动车在夜间通过没有交通信号灯控制的交叉路口时，要怎样使用灯光？', '使用远光灯', '使用近光灯', '使用危险报警闪光灯', '使用危险报警闪光灯', 'D', '《道路交通安全法实施条例》第五十九条：机动车在夜间通过急弯、坡路、拱桥、人行横道或者没有交通信号灯控制的路口时，应当交替使用远近光灯示意。');
INSERT INTO `paper4` VALUES ('147', '判断题', '车辆在泥泞路段发生侧滑时，要向车尾侧滑方向缓打方向盘修正', '', '', '', '', 'A', '这题可以这么理解，后轮发生侧滑，当然要向侧滑的一侧转动转向轮来使前轮与之对应，否则不就原地打转了嘛。');
INSERT INTO `paper4` VALUES ('151', '判断题', '机动车可以选择交叉路口进行倒车。', '', '', '', '', 'B', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。');
INSERT INTO `paper4` VALUES ('152', '判断题', '驾驶机动车驶出环岛时，应先驶入最右侧车道不用开启转向灯驶离即可。', '', '', '', '', 'B', '驶出环岛，需要先开启右转向灯。');
INSERT INTO `paper4` VALUES ('154', '判断题', '下坡路制动失效后，在不得已的情况下，可用车身侧面擦撞山坡，迫使机动车减速停车。', '', '', '', '', 'A', '刹车突然失灵时，摩擦力特别能显神奇功效。可用车前保险杠、车厢等钢性部位与路边岩石、大树或土坡摩擦、碰撞，在不威胁乘车人安全的情况下强行停车。这样，虽对车会造成损害，但是命更重要，就别心疼车了。因此本题正确。');
INSERT INTO `paper4` VALUES ('159', '判断题', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应持续鸣喇叭催促。', '', '', '', '', 'B', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应注意观察车况，合理超车。');
INSERT INTO `paper4` VALUES ('161', '判断题', '同方向有三条机动车道的路段，校车在右侧车道停靠上、下学生时，校车停靠车道后方和相邻机动车道上的机动车应停车等待。', '', '', '', '', 'A', '根据规定，校车在同方向只有一条机动车道的道路上停靠时，后方车辆应当停车等待，不得超越。校车在同方向有两条以上机动车道的道路上停靠时，校车停靠车道后方和相邻机动车道上的机动车应当停车等待，其他机动车道上的机动车应当减速通过。');
INSERT INTO `paper4` VALUES ('172', '判断题', ' 驾驶机动车从辅路汇入主路车流时要迅速。', '', '', '', '', 'B', '驾车要谨慎，不要那么“迅速”！注意是汇入车流，所以正确的做法是要减速慢行，在不影响其他车辆正常行驶的情况下汇入主路。');
INSERT INTO `paper4` VALUES ('173', '判断题', '预计在超车过程中与对面来车有会车可能时，应提前加速超越。', '', '', '', '', 'B', '预计在超车过程中与对面来车有会车可能时，应当放弃超车。若加速超越，有可能会引起不必要的事故。');
INSERT INTO `paper4` VALUES ('179', '判断题', '机动车不得在隧道中倒车。', '', '', '', '', 'A', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题正确。');
INSERT INTO `paper4` VALUES ('181', '判断题', '在行驶中，驾驶人在注意与前车保持安全距离的同时，也要谨慎制动，防止被后车追尾。', '', '', '', '', 'A', '在行驶过程中要留意与前后车的距离，因此若是贸然使用制动，很容易使后车来不及反应发生追尾，所以本题正确。');
INSERT INTO `paper4` VALUES ('185', '判断题', '机动车遇有急弯路时要在进入弯路后减速。', '', '', '', '', 'B', '遇到急弯路应当提前减速慢行，等到进入弯路后减速很容易发生侧滑或侧翻。因此本题错误');
INSERT INTO `paper4` VALUES ('192', '多选题', '周某夜间驾驶大货车在没有路灯的城市道路上以90公里/小时的速度行驶，一直开启远光灯，在通过一窄路时，因加速抢道，导致对面驶来的一辆小客车撞上右侧护栏。周某的主要违法行为是什么？', '超速行驶', '不按规定会车', '疲劳驾驶', '不按规定使用灯光', 'ABD', '第一，夜间没有路灯的情况下90公里/小时，超速。第二，通过窄路时，应该会车减速行驶。第三，应该交替使用近远光灯。');
INSERT INTO `paper4` VALUES ('251', '单选题', '在冰雪路面制动时，发现车辆偏离方向，以下说法正确的是？', '连续轻踩轻放刹车', '用力踩刹车', '停止踩刹车', '以上说法都不对', 'C', '这个情况下，立即踏制动踏板容易引起侧翻。如后轮一直被刹住的情况下，不松开踏板，汽车会出现方向驶去控制。正确的做法是先握紧方向盘，不要紧急踩刹车。');
INSERT INTO `paper4` VALUES ('253', '单选题', '后轮胎爆裂时，驾驶人要如何处置？', '迅速转动转向盘调整', '控制行驶方向并慢慢减速', '迅速向相反方向转动转向盘', '迅速采取制动措施', 'B', '若是在行驶中突然打方向，车子会飘或者翻侧的。用紧急制动有可能会发生侧滑或侧翻。');
INSERT INTO `paper4` VALUES ('262', '单选题', '出车前对轮胎进行哪些方面的检查？', '什么也不用检查', '轮胎有没有清洗', '备胎在什么位置', '轮胎的紧固和气压', 'D', '对轮胎的检查是为了确保在行车过程中能安全行驶，由此本题应选“轮胎的紧固和气压”。');
INSERT INTO `paper4` VALUES ('264', '单选题', '机动车在紧急制动时ABS系统会起到什么作用？', '缩短制动距离', '保持转向能力', '减轻制动惯性', '自动控制方向', 'B', 'ABS“防抱死刹车系统”看名字就大概知道了。它是一种具有怎样调整汽车座椅安全头枕的高度？防滑、防锁死等优点的安全刹车控制系统。没有安装ABS系统的车，在遇到紧急情况时，来不及分步缓刹，只能一脚踩死。');
INSERT INTO `paper4` VALUES ('278', '单选题', ' 驾驶机动车应当怎样汇入主路车流?', '加速直接汇入车流', '开启转向灯观察主路情况确保安全汇入车流', '开启转向灯直接汇入车流', '开启转向灯直接汇入车流', 'B', '开启转向灯观察主路情况确保安全汇入车流。');
INSERT INTO `paper4` VALUES ('289', '单选题', '超车过程中，被超车辆突然加速怎么办？', '加速迅速超越', '加速迅速超越', '持续鸣喇叭超越', '持续鸣喇叭超越', 'C', '超车过程中，被超车辆突然加速，应该减速放弃超车，否则容易引发事故。');
INSERT INTO `paper4` VALUES ('291', '判断题', '救助失血过多出现休克的伤员要采取保暖措施。', '', '', '', '', 'A', '失血过多+休克的伤员；注意是休克，休克的意思是血压下降，口渴，体温下降，意识模糊，皮肤发白，尿量减少的一种状态。所以要采取保暖措施。');
INSERT INTO `paper4` VALUES ('292', '判断题', '浓雾中行车听到对方车辆鸣喇叭时，只要在视野中看不到，可不去理会', '', '', '', '', 'B', '雾天行车听到对方鸣喇叭，也应该鸣喇叭回应，已提示对方车辆。');
INSERT INTO `paper4` VALUES ('296', '判断题', '腐蚀品着火时，不能用水柱直接喷射扑救。', '', '', '', '', 'A', '无机腐蚀品或有机腐蚀品直接燃烧时，除具有与水反应特性的物质外，一般可用大量的水扑救。但宜用雾状水，不能用高压水柱直接喷射物品，以免飞溅的水珠带上腐蚀品灼伤灭火人员。');
INSERT INTO `paper4` VALUES ('307', '判断题', '汽车的专用备胎可作为正常轮胎长期使用', '', '', '', '', 'B', '专用备胎，说明是用来作为备用轮胎的，因此不能作为正常轮胎长期使用。所以本题选择错误。');
INSERT INTO `paper4` VALUES ('308', '判断题', '安装防抱死制动装置（ABS）的机动车紧急制动时，可用力踏制动踏板。', '', '', '', '', 'A', 'ABS技术的出现，就是大大地降低了侧滑，和原地掉头的现象，保证了行驶的安全。如果，你在使用带ABS的车辆，在刹车时的动作，类似不带ABS的车这样轻轻的踩下去，很可能会不能触发ABS系统，也就起不到ABS的作用了，所以，一般就是要求，刹车动作要果断，一脚就踩到底，保证ABS的正确执行。');
INSERT INTO `paper4` VALUES ('316', '判断题', '预计在超车过程中与对面来车有会车可能时，应提前加速超越。', '', '', '', '', 'B', '预计在超车过程中与对面来车有会车可能时，应当放弃超车。若加速超越，有可能会引起不必要的事故。');
INSERT INTO `paper4` VALUES ('320', '判断题', '在道路上停车时要尽量避开坡道、积水、结冰或松软路面。', '', '', '', '', 'A', '在道路上停车时要尽量避开坡道、积水、结冰或松软路面，防止路面垮塌。');
INSERT INTO `paper4` VALUES ('322', '判断题', '机动车不得在隧道中倒车。', '', '', '', '', 'A', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题正确。');
INSERT INTO `paper4` VALUES ('326', '判断题', '在道路上行车时，安全跟车距离无需随着速度变化而变化。', '', '', '', '', 'B', '安全跟车距离【需要】随着速度变化而变化，车速越高，跟车的安全距离要随之增大，这样才能保证安全。因此本题错误。');
INSERT INTO `paper4` VALUES ('338', '多选题', '驾驶汽车超速行驶有哪些危害？', '反应距离延长', '视野变窄', '加重事故后果', '制动距离延长', 'ABCD', 'A车速快，反应距离延长；B车速快2边的事物会比较模糊，视野就会窄；C车速快，由于惯性，碰撞引起的后果就严重；D车速快，制动距离自然延长。');
INSERT INTO `paper5` VALUES ('011', '单选题', '某日早上6时，冉某驾驶一辆大客车出发，连续行驶至上午11时，在宣汉县境内宣南路1公里处，坠于公路一侧垂直高度8.5米的陡坎下，造成13人死亡、9人受伤。冉某的主要违法行为是什么？', '超速行驶', '不按交通标线行驶', '客车超员', '疲劳驾驶', 'D', '规定：连续4小时就要停车休息20分钟！本题连续驾驶5小时，属于疲劳驾驶。');
INSERT INTO `paper5` VALUES ('017', '单选题', '会车中道路一侧有障碍，双方机动车应如何做？', '无障碍一方让对向先行', '速度慢的让速度快的先行', '有障碍的一方让对向先行', '速度快的让速度慢的先行', 'C', '有障碍的让无障碍的一方先行；但有障碍的一方已经驶入有障碍路段而无障碍一方未驶入的，有障碍的一方先行。');
INSERT INTO `paper5` VALUES ('023', '单选题', '机动车在雪天临时停车时，应开启什么灯？', '前后防雾灯、示廓灯和后位灯', '倒车灯、示廓灯和后位灯', '前大灯、示廓灯和后位灯', '危险报警闪光灯、示廓灯和后位灯', 'D', '雪天开车视野不良，因此若要停车，就应该开启危险报警闪光灯、示廓灯和后位灯，提醒其他车辆注意。');
INSERT INTO `paper5` VALUES ('024', '单选题', '机动车停车的错误做法是什么？', '应当在规定地点停放', '禁止在人行道上停放', '在道路上临时停车时，不得妨碍其他机动车和行人通行', '可以停放在非机动车道上', 'D', '注意本题考的是错误的做法，机动车不能停放在非机动车道上。');
INSERT INTO `paper5` VALUES ('038', '判断题', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应持续鸣喇叭催促。', '', '', '', '', 'B', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应注意观察车况，合理超车。');
INSERT INTO `paper5` VALUES ('044', '判断题', '安装防抱死制动装置（ABS）的机动车紧急制动时，可用力踏制动踏板。', '', '', '', '', 'A', 'ABS技术的出现，就是大大地降低了侧滑，和原地掉头的现象，保证了行驶的安全。如果，你在使用带ABS的车辆，在刹车时的动作，类似不带ABS的车这样轻轻的踩下去，很可能会不能触发ABS系统，也就起不到ABS的作用了，所以，一般就是要求，刹车动作要果断，一脚就踩到底，保证ABS的正确执行。');
INSERT INTO `paper5` VALUES ('047', '判断题', '安全头枕要调整到与颈部平齐的高度', '', '', '', '', 'B', '如果后方有车辆撞击，头部由于惯性会后冲，没有头枕保护，颈椎有可能折断。所以头枕的中心一定要与头齐平。');
INSERT INTO `paper5` VALUES ('048', '判断题', '驾驶汽车在雨天起步前要使用刮水器', '', '', '', '', 'A', '驾驶汽车在雨天起步前要使用刮水器，增加视线区域。');
INSERT INTO `paper5` VALUES ('056', '判断题', '在道路上停车时要尽量避开坡道、积水、结冰或松软路面。', '', '', '', '', 'A', '在道路上停车时要尽量避开坡道、积水、结冰或松软路面，防止路面垮塌。');
INSERT INTO `paper5` VALUES ('057', '判断题', '机动车倒车时，后方道路条件较好的，应加速倒车，迅速完成操作。', '', '', '', '', 'B', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题错误。');
INSERT INTO `paper5` VALUES ('107', '单选题', '驾驶机动车在山区道路因故障停车需要注意什么？', '选择下坡路段停放', '选择上坡路段停放', '选择平缓路段停放', '选择坡顶位置停放', 'C', '停车时要尽可能选择安全的地点停车，而不管是上坡路、下坡路或是坡顶都有可能让所停车辆发生溜车。');
INSERT INTO `paper5` VALUES ('110', '单选题', '后轮胎爆裂时，驾驶人要如何处置？', '迅速转动转向盘调整', '控制行驶方向并慢慢减速', '迅速向相反方向转动转向盘', '迅速采取制动措施', 'B', '若是在行驶中突然打方向，车子会飘或者翻侧的。用紧急制动有可能会发生侧滑或侧翻。');
INSERT INTO `paper5` VALUES ('111', '单选题', '驾驶机动车遇到这样的情景怎样行驶？', '连续鸣喇叭', '快速通过', '减速慢行', '从一侧绕行', 'C', '遇到这样的情况要减速慢行，必要时停车避让，以免孩子们突然跑动被撞伤。');
INSERT INTO `paper5` VALUES ('112', '单选题', '检查机动车机油时，以下做法正确是什么?', '停在平坦的地方，在启动前检查', '停在平坦的地方，在怠速状态下检查', '无需停在平坦的地方，在启动前检查', '无需停在平坦的地方，在怠速状态下检查', 'A', '对的检查的方式是需要注意检查的条件.千万不要在汽车发动的时候去检查。检查的时候要把车先停好，然后拉紧手刹，再取出机油尺，先族干净后放进去，然后再重新拿出来检查机油油位。如果在机油尺下端的标记之间.就表示了油且是正常的。如果在标记下面，就表示机油留太少。机油太多的话就会出现在机油最在标记上面。如果少了就需要适里添加机油。');
INSERT INTO `paper5` VALUES ('114', '单选题', '驾驶机动车进入高速公路隧道前需要注意什么？', '开启远光灯行驶', '开启示宽灯、尾灯行驶', '开启近光灯行驶', '到达隧道口时鸣喇叭', 'C', '进入隧道时相当于夜间行驶了，因此要开启近光灯。');
INSERT INTO `paper5` VALUES ('119', '单选题', '出车前对轮胎进行哪些方面的检查？', '什么也不用检查', '轮胎有没有清洗', '备胎在什么位置', '轮胎的紧固和气压', 'D', '对轮胎的检查是为了确保在行车过程中能安全行驶，由此本题应选“轮胎的紧固和气压”。');
INSERT INTO `paper5` VALUES ('128', '单选题', '机动车停车的错误做法是什么？', '应当在规定地点停放', '禁止在人行道上停放', '在道路上临时停车时，不得妨碍其他机动车和行人通行', '可以停放在非机动车道上', 'D', '注意本题考的是错误的做法，机动车不能停放在非机动车道上。');
INSERT INTO `paper5` VALUES ('129', '单选题', ' 夜间驾驶机动车在窄路或者窄桥遇自行车对向驶来时，要怎样使用灯光？', '连续变换远、近光灯', '使用示廓灯', '使用远光灯', '使用近光灯', 'D', '根据《道路交通安全法实施条例》第四十八条：在没有中心隔离设施或者没有中心线的道路上，机动车遇相对方向来车时应当遵守下列规定：（五）夜间会车应当在距相对方向来车150米以外改用近光灯，在窄路、窄桥与非机动车会车时应当使用近光灯。');
INSERT INTO `paper5` VALUES ('130', '单选题', '夜间机动车通过照明条件良好的路段时，要怎样使用灯光', '前后雾灯', '近光灯', '远光灯', '危险报警闪光灯', 'B', '用近光灯不会照得对方看不见路，同时为了安全起见，开启近光灯能够让相互间清晰可见。');
INSERT INTO `paper5` VALUES ('134', '单选题', ' 驾驶机动车从高速公路加速车道汇入行车道车流时，以下做法正确的是什么?', '从正常行驶车辆后驶入行车道', '从正常行驶车辆前驶入行车道', '停车等待正常行驶车辆通过', '加速直接驶入行车道', 'A', '加速车道指的是供车辆驶入高速车流之前加速用的车道。从正常行驶车辆后驶入行车道。');
INSERT INTO `paper5` VALUES ('144', '单选题', '在山区道路行驶时，以下说法正确的是什么？', '上坡路段的安全距离应比平坦路段的大', '急弯路段应当紧随前车', '下坡路段的安全距离应比平坦路段的小', '下坡路段的安全距离应比平坦路段的小', 'A', '上坡路段的安全距离应比平坦路段的大。上坡需要加速，为了避免和前车发生追尾，需要加大安全距离。');
INSERT INTO `paper5` VALUES ('149', '判断题', '浓雾中行车听到对方车辆鸣喇叭时，只要在视野中看不到，可不去理会', '', '', '', '', 'B', '雾天行车听到对方鸣喇叭，也应该鸣喇叭回应，已提示对方车辆。');
INSERT INTO `paper5` VALUES ('152', '判断题', '驾驶机动车驶出环岛时，应先驶入最右侧车道不用开启转向灯驶离即可。', '', '', '', '', 'B', '驶出环岛，需要先开启右转向灯。');
INSERT INTO `paper5` VALUES ('177', '判断题', '在道路上停车时要尽量避开坡道、积水、结冰或松软路面。', '', '', '', '', 'A', '在道路上停车时要尽量避开坡道、积水、结冰或松软路面，防止路面垮塌。');
INSERT INTO `paper5` VALUES ('178', '判断题', '机动车倒车时，后方道路条件较好的，应加速倒车，迅速完成操作。', '', '', '', '', 'B', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题错误。');
INSERT INTO `paper5` VALUES ('182', '判断题', '在道路上跟车行驶时，跟车距离不是主要的，只须保持与前车相等的速度，即可防止发生追尾事故。', '', '', '', '', 'B', '跟车距离很重要，不同的道路对跟车距离要求是不一样的。假设你跟前车的的速度相等，但是距离是1米，是不可能刹得住车的。');
INSERT INTO `paper5` VALUES ('185', '判断题', '机动车遇有急弯路时要在进入弯路后减速。', '', '', '', '', 'B', '遇到急弯路应当提前减速慢行，等到进入弯路后减速很容易发生侧滑或侧翻。因此本题错误');
INSERT INTO `paper5` VALUES ('188', '多选题', ' 驾驶机动车在山区道路上坡路段接近坡顶时，超车存在风险，以下说法正确的是什么？', '接近坡顶时视线受阻，无法观察坡顶之后道路走向', '接近坡顶时视线受阻，无法观察对向来车情况', '接近坡顶时车速较慢', '接近坡顶时视线受阻，无法观察坡顶之后是否有障碍物', 'ABD', '驾驶机动车在山区道路上坡路段接近坡顶时，接近坡顶时视线受阻需要注意：观察坡顶之后道路走向；观察对向来车情况；观察坡顶之后是否有障碍物。');
INSERT INTO `paper5` VALUES ('197', '多选题', '某日19时，杨某驾驶大客车，乘载57人（核载55人），连续行驶至次日凌晨1时,在金城江区境内050国道3008公里加110米处，因机动车左前胎爆裂，造成12人死亡、22人受伤的特大交通事故。杨某的主要违法行为是什么？', '疲劳驾驶', '客车超员', '超速行驶', '操作不当', 'AB', '违法行为：1、题目提到连续行驶到次日凌晨1时，属疲劳驾驶。2、题目提到只能做55以上，却坐了57人，属客车超员。');
INSERT INTO `paper5` VALUES ('198', '多选题', '唐某驾驶一辆大客车，乘载74人（核载30人），以每小时38公里的速度，行至一连续下陡坡转弯路段时，机动车翻入路侧溪水内，造成17人死亡、57人受伤。唐某的主要违法行为是什么？', '酒后驾驶', '客车超员', '疲劳驾驶', '超速行驶', 'BD', '违法行为：1、乘载74人(核载30人)所以客车超员。2、弯道限速30公里/每小时，所以超速行驶。');
INSERT INTO `paper5` VALUES ('250', '单选题', '驾驶机动车在山区道路因故障停车需要注意什么？', '选择下坡路段停放', '选择上坡路段停放', '选择平缓路段停放', '选择坡顶位置停放', 'C', '停车时要尽可能选择安全的地点停车，而不管是上坡路、下坡路或是坡顶都有可能让所停车辆发生溜车。');
INSERT INTO `paper5` VALUES ('256', '单选题', '如何为特种车辆让路?', '向左减速让路，直到紧急车辆过去', '向右减速让路，直到紧急车辆过去', '立即停车，即使你在交叉口也是如此', '向前车鸣喇叭，自己在特种车辆前开路', 'B', '《道路交通安全法》第五十三条：警车、消防车、救护车、工程救险车执行紧急任务时，可以使用警报器、标志灯具；在确保安全的前提下，不受行驶路线、行驶方向、行驶速度和信号灯的限制，其他车辆和行人应当让行。警车、消防车、救护车、工程救险车非执行紧急任务时，不得使用警报器、标志灯具，不享有前款规定的道路优先通行权。让路的都是靠右边，并且是减速的。');
INSERT INTO `paper5` VALUES ('261', '单选题', ' 驾驶人进入驾驶室前，首先要做什么？', '观察机动车周围情况', '不用观察周围情况', '开启车门直接上车', '注意观察天气情况', 'A', '注意“进入驾驶室前”，也就是上车前，因此本题选“观察机动车周围情况”。');
INSERT INTO `paper5` VALUES ('262', '单选题', '出车前对轮胎进行哪些方面的检查？', '什么也不用检查', '轮胎有没有清洗', '备胎在什么位置', '轮胎的紧固和气压', 'D', '对轮胎的检查是为了确保在行车过程中能安全行驶，由此本题应选“轮胎的紧固和气压”。');
INSERT INTO `paper5` VALUES ('271', '单选题', '机动车停车的错误做法是什么？', '应当在规定地点停放', '禁止在人行道上停放', '在道路上临时停车时，不得妨碍其他机动车和行人通行', '可以停放在非机动车道上', 'D', '注意本题考的是错误的做法，机动车不能停放在非机动车道上。');
INSERT INTO `paper5` VALUES ('278', '单选题', ' 驾驶机动车应当怎样汇入主路车流?', '加速直接汇入车流', '开启转向灯观察主路情况确保安全汇入车流', '开启转向灯直接汇入车流', '开启转向灯直接汇入车流', 'B', '开启转向灯观察主路情况确保安全汇入车流。');
INSERT INTO `paper5` VALUES ('280', '单选题', '驶入高速公路减速车道后，应关闭转向灯，注意观察限速标志，进入匝道之前将车速降到多少以下?', '标志规定车速', '每小时80公里', '每小时60公里', '每小时40公里', 'A', '减速车道有限速标志，应该按限速标志规定的车速行驶。');
INSERT INTO `paper5` VALUES ('285', '单选题', '驾驶机动车遇到前方车辆停车，等待行人通过人行横道时，以下做法正确的是什么？', '从左侧超越前车', '鸣喇叭催促前车向前行驶', '从右侧超越前车', '与前车保持安全距离,排队等待', 'D', '前车等待行人过道时，自己也应耐心等待，B做法不恰当，AC做法易引发交通事故。');
INSERT INTO `paper5` VALUES ('293', '判断题', ' 驾驶机动车在高速公路上行驶，能见度小于50米时，只要车速不超过20公里/小时，可以不驶离高速公路。', '', '', '', '', 'B', '在高速公路上，能见度小于50米时，开启雾灯、近光灯、示廓灯、前后位灯和危险报警闪光灯，车速不得超过每小时20公里，并从最近的出口尽快驶离高速公路。');
INSERT INTO `paper5` VALUES ('294', '判断题', '机动车可以选择交叉路口进行倒车。', '', '', '', '', 'B', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。');
INSERT INTO `paper5` VALUES ('297', '判断题', '下坡路制动失效后，在不得已的情况下，可用车身侧面擦撞山坡，迫使机动车减速停车。', '', '', '', '', 'A', '刹车突然失灵时，摩擦力特别能显神奇功效。可用车前保险杠、车厢等钢性部位与路边岩石、大树或土坡摩擦、碰撞，在不威胁乘车人安全的情况下强行停车。这样，虽对车会造成损害，但是命更重要，就别心疼车了。因此本题正确。');
INSERT INTO `paper5` VALUES ('300', '判断题', '为防止有害气体中毒伤员继续中毒，首先将伤员转移到空气新鲜的地方。', '', '', '', '', 'A', '中毒伤员所处的空间肯定空气不流通，空气新鲜的地方可以让人体的呼吸管道起畅通的作用。因此应当先转移位置到空气新鲜的地方。因此本题正确。');
INSERT INTO `paper5` VALUES ('302', '判断题', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应持续鸣喇叭催促。', '', '', '', '', 'B', '驾驶机动车行驶过程中，如遇到前方车辆行驶速度缓慢时，应注意观察车况，合理超车。');
INSERT INTO `paper5` VALUES ('312', '判断题', '驾驶汽车在雨天起步前要使用刮水器', '', '', '', '', 'A', '驾驶汽车在雨天起步前要使用刮水器，增加视线区域。');
INSERT INTO `paper5` VALUES ('315', '判断题', ' 驾驶机动车从辅路汇入主路车流时要迅速。', '', '', '', '', 'B', '驾车要谨慎，不要那么“迅速”！注意是汇入车流，所以正确的做法是要减速慢行，在不影响其他车辆正常行驶的情况下汇入主路。');
INSERT INTO `paper5` VALUES ('318', '判断题', '道路划设专用车道的，在专用车道内，其他机动车可以借道超车。', '', '', '', '', 'B', '专用车道指的是“机动车道、非机动车道、人行道”这些都属于专用车道，什么车走什么道，应该就不能借道超车，否则有可能开到人行道上去借道超车！');
INSERT INTO `paper5` VALUES ('327', '判断题', '行车中变更车道不需要提前开启转向灯', '', '', '', '', 'B', '变更车道一定要【提前】开启转向灯。');
INSERT INTO `paper5` VALUES ('328', '判断题', '机动车遇有急弯路时要在进入弯路后减速。', '', '', '', '', 'B', '遇到急弯路应当提前减速慢行，等到进入弯路后减速很容易发生侧滑或侧翻。因此本题错误');
INSERT INTO `paper5` VALUES ('331', '多选题', ' 驾驶机动车在山区道路上坡路段接近坡顶时，超车存在风险，以下说法正确的是什么？', '接近坡顶时视线受阻，无法观察坡顶之后道路走向', '接近坡顶时视线受阻，无法观察对向来车情况', '接近坡顶时车速较慢', '接近坡顶时视线受阻，无法观察坡顶之后是否有障碍物', 'ABD', '驾驶机动车在山区道路上坡路段接近坡顶时，接近坡顶时视线受阻需要注意：观察坡顶之后道路走向；观察对向来车情况；观察坡顶之后是否有障碍物。');
INSERT INTO `paper5` VALUES ('332', '多选题', ' 驾驶机动车通过学校门口时应注意什么?', '注意观察标志标线', '注意减速慢行', '不要鸣喇叭', '快速通过', 'ABC', '车辆通过学校和小区应注葱观察标志标线.低速行驶，不要鸣喇叭，减少噪音，以免影响学生学习。');
INSERT INTO `paper6` VALUES ('001', '单选题', '驾驶机动车在山区道路因故障停车需要注意什么？', '选择下坡路段停放', '选择上坡路段停放', '选择平缓路段停放', '选择坡顶位置停放', 'C', '停车时要尽可能选择安全的地点停车，而不管是上坡路、下坡路或是坡顶都有可能让所停车辆发生溜车。');
INSERT INTO `paper6` VALUES ('002', '单选题', '在冰雪路面制动时，发现车辆偏离方向，以下说法正确的是？', '连续轻踩轻放刹车', '用力踩刹车', '停止踩刹车', '以上说法都不对', 'C', '这个情况下，立即踏制动踏板容易引起侧翻。如后轮一直被刹住的情况下，不松开踏板，汽车会出现方向驶去控制。正确的做法是先握紧方向盘，不要紧急踩刹车。');
INSERT INTO `paper6` VALUES ('008', '单选题', '驾驶机动车进入高速公路隧道前需要注意什么？', '开启远光灯行驶', '开启示宽灯、尾灯行驶', '开启近光灯行驶', '到达隧道口时鸣喇叭', 'C', '进入隧道时相当于夜间行驶了，因此要开启近光灯。');
INSERT INTO `paper6` VALUES ('022', '单选题', '机动车在雾天临时停车时，应开启什么灯？', '左转向灯、示廓灯和后位灯', '前大灯、示廓灯和后位灯', '倒车灯、示廓灯和后位灯', '危险报警闪光灯、示廓灯和后位灯', 'D', '夜间行驶时视野不良，因此若要停车，应当开启危险报警闪光灯，提醒其他车辆注意。');
INSERT INTO `paper6` VALUES ('023', '单选题', '机动车在雪天临时停车时，应开启什么灯？', '前后防雾灯、示廓灯和后位灯', '倒车灯、示廓灯和后位灯', '前大灯、示廓灯和后位灯', '危险报警闪光灯、示廓灯和后位灯', 'D', '雪天开车视野不良，因此若要停车，就应该开启危险报警闪光灯、示廓灯和后位灯，提醒其他车辆注意。');
INSERT INTO `paper6` VALUES ('025', '单选题', ' 夜间驾驶机动车在窄路或者窄桥遇自行车对向驶来时，要怎样使用灯光？', '连续变换远、近光灯', '使用示廓灯', '使用远光灯', '使用近光灯', 'D', '根据《道路交通安全法实施条例》第四十八条：在没有中心隔离设施或者没有中心线的道路上，机动车遇相对方向来车时应当遵守下列规定：（五）夜间会车应当在距相对方向来车150米以外改用近光灯，在窄路、窄桥与非机动车会车时应当使用近光灯。');
INSERT INTO `paper6` VALUES ('027', '判断题', '救助失血过多出现休克的伤员要采取保暖措施。', '', '', '', '', 'A', '失血过多+休克的伤员；注意是休克，休克的意思是血压下降，口渴，体温下降，意识模糊，皮肤发白，尿量减少的一种状态。所以要采取保暖措施。');
INSERT INTO `paper6` VALUES ('030', '判断题', '机动车可以选择交叉路口进行倒车。', '', '', '', '', 'B', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。');
INSERT INTO `paper6` VALUES ('032', '判断题', '腐蚀品着火时，不能用水柱直接喷射扑救。', '', '', '', '', 'A', '无机腐蚀品或有机腐蚀品直接燃烧时，除具有与水反应特性的物质外，一般可用大量的水扑救。但宜用雾状水，不能用高压水柱直接喷射物品，以免飞溅的水珠带上腐蚀品灼伤灭火人员。液体腐蚀品应用干砂、干土覆盖吸收，扫干净后，再用水洗刷。大量溢出时可用稀酸或稀碱中和。中和时，要防止发生剧烈反应。用水洗刷撒漏现场时，只能缓慢地浇洗或用雾状水喷淋，以防水珠飞溅伤人。');
INSERT INTO `paper6` VALUES ('034', '判断题', '驾驶机动车在山区冰雪道路上行驶，遇到前车正在爬坡时，后车应选择适当地点停车，等前车通过后再爬坡。', '', '', '', '', 'A', '驾驶机动车在山区冰雪道路上行驶，遇到前车正在爬坡时，后车应选择适当地点停车，等前车通过后再爬坡，后车应远离前车，避免前车打滑后退相撞。');
INSERT INTO `paper6` VALUES ('043', '判断题', '汽车的专用备胎可作为正常轮胎长期使用', '', '', '', '', 'B', '专用备胎，说明是用来作为备用轮胎的，因此不能作为正常轮胎长期使用。所以本题选择错误。');
INSERT INTO `paper6` VALUES ('044', '判断题', '安装防抱死制动装置（ABS）的机动车紧急制动时，可用力踏制动踏板。', '', '', '', '', 'A', 'ABS技术的出现，就是大大地降低了侧滑，和原地掉头的现象，保证了行驶的安全。如果，你在使用带ABS的车辆，在刹车时的动作，类似不带ABS的车这样轻轻的踩下去，很可能会不能触发ABS系统，也就起不到ABS的作用了，所以，一般就是要求，刹车动作要果断，一脚就踩到底，保证ABS的正确执行。');
INSERT INTO `paper6` VALUES ('047', '判断题', '安全头枕要调整到与颈部平齐的高度', '', '', '', '', 'B', '如果后方有车辆撞击，头部由于惯性会后冲，没有头枕保护，颈椎有可能折断。所以头枕的中心一定要与头齐平。');
INSERT INTO `paper6` VALUES ('060', '判断题', '在行驶中，驾驶人在注意与前车保持安全距离的同时，也要谨慎制动，防止被后车追尾。', '', '', '', '', 'A', '在行驶过程中要留意与前后车的距离，因此若是贸然使用制动，很容易使后车来不及反应发生追尾，所以本题正确。');
INSERT INTO `paper6` VALUES ('061', '判断题', '在道路上跟车行驶时，跟车距离不是主要的，只须保持与前车相等的速度，即可防止发生追尾事故。', '', '', '', '', 'B', '跟车距离很重要，不同的道路对跟车距离要求是不一样的。假设你跟前车的的速度相等，但是距离是1米，是不可能刹得住车的。');
INSERT INTO `paper6` VALUES ('062', '判断题', '在道路上行车时，安全跟车距离无需随着速度变化而变化。', '', '', '', '', 'B', '安全跟车距离【需要】随着速度变化而变化，车速越高，跟车的安全距离要随之增大，这样才能保证安全。因此本题错误。');
INSERT INTO `paper6` VALUES ('083', '多选题', ' 邹某驾驶大型卧铺客车（核载35人，实载47人），行至京港澳高速公路938公里时，因乘车人携带的大量危险化学品在车厢内突然发生爆燃，造成41人死亡，6人受伤。此事故中的主要违法行为是什么？', '客车超员', '乘车人携带易燃易爆危险物品', '超速行驶', '不按规定停车', 'AB', '违法行为：1、核载35人，实载47人为超载；2、乘车人携带的大量危险化学品。');
INSERT INTO `paper6` VALUES ('109', '单选题', '雨天机动车在高速公路行驶发生“水滑”现象时怎样处置？', '急踏制动踏板减速', '缓抬加速踏板减速', '迅速转向进行调整', '提速增大车轮排水量', 'B', '所谓“水滑”现象就是雨天汽车在积水路面上高速行驶时，轮胎与路面间的存水不能排除，水的压力使轮胎上浮，形成汽车在积水路面上滑行的现象。选项ACD都有可能造成车辆侧滑等事故的发生，而通过缓抬加速踏板的方式减速才能真正让车渐渐减慢。');
INSERT INTO `paper6` VALUES ('116', '单选题', ' 如图所示，驾驶机动车遇到这种主路左侧来车的情况，以下说法正确的是什么？', '左侧来车应该给己车让行', '己车应该给左侧来车让行', '不需让行，谁车速快谁先过', '不需让行，己车有优先通行权', 'B', '图中路考为辅路近主路，此时己车应该给左侧来车让行。');
INSERT INTO `paper6` VALUES ('137', '单选题', '驶入高速公路减速车道后，应关闭转向灯，注意观察限速标志，进入匝道之前将车速降到多少以下?', '标志规定车速', '每小时80公里', '每小时60公里', '每小时40公里', 'A', '减速车道有限速标志，应该按限速标志规定的车速行驶。');
INSERT INTO `paper6` VALUES ('144', '单选题', '在山区道路行驶时，以下说法正确的是什么？', '上坡路段的安全距离应比平坦路段的大', '急弯路段应当紧随前车', '下坡路段的安全距离应比平坦路段的小', '下坡路段的安全距离应比平坦路段的小', 'A', '上坡路段的安全距离应比平坦路段的大。上坡需要加速，为了避免和前车发生追尾，需要加大安全距离。');
INSERT INTO `paper6` VALUES ('145', '单选题', '驾驶汽车频繁变更车道的危害以下选项错误的是？', '扰乱交通秩序', '易导致爆胎', '影响正常通行', '易引发交通事故', 'B', '请注意审题，题目要求选择错误选项，频繁变更车道爆胎关系不大。');
INSERT INTO `paper6` VALUES ('153', '判断题', '腐蚀品着火时，不能用水柱直接喷射扑救。', '', '', '', '', 'A', '无机腐蚀品或有机腐蚀品直接燃烧时，除具有与水反应特性的物质外，一般可用大量的水扑救。但宜用雾状水，不能用高压水柱直接喷射物品，以免飞溅的水珠带上腐蚀品灼伤灭火人员。');
INSERT INTO `paper6` VALUES ('156', '判断题', ' 驾驶机动车遇到骑自行车人占道影响通行时，可连续鸣喇叭加速从其左侧绕行。', '', '', '', '', 'B', '遇到这种情况应当减速慢行，必要时避让。因此本题错误。');
INSERT INTO `paper6` VALUES ('171', '判断题', '驾驶机动车汇入车流时不能影响其他机动车通行。', '', '', '', '', 'A', '汇入车流的前提是不能影响其他车辆的正常通行，因此本题正确。');
INSERT INTO `paper6` VALUES ('180', '判断题', '夜间驾驶机动车在照明条件良好的路段可以不使用灯光', '', '', '', '', 'B', '用近光灯不会照得对方看不见路，同时为了安全起见，开启近光灯能够让相互间清晰可见。因此本题错误。');
INSERT INTO `paper6` VALUES ('188', '多选题', ' 驾驶机动车在山区道路上坡路段接近坡顶时，超车存在风险，以下说法正确的是什么？', '接近坡顶时视线受阻，无法观察坡顶之后道路走向', '接近坡顶时视线受阻，无法观察对向来车情况', '接近坡顶时车速较慢', '接近坡顶时视线受阻，无法观察坡顶之后是否有障碍物', 'ABD', '驾驶机动车在山区道路上坡路段接近坡顶时，接近坡顶时视线受阻需要注意：观察坡顶之后道路走向；观察对向来车情况；观察坡顶之后是否有障碍物。');
INSERT INTO `paper6` VALUES ('196', '多选题', '叶某驾驶中型厢式货车，行至陂头镇上汶线3公里加600米弯道路段时，以40公里/小时的速度与王某驾驶的乘载19人正三轮载货摩托车发生正面相撞，造成10人死亡、9人受伤。双方驾驶人的主要违法行为是什么', '叶某驾驶与准驾车型不符的机动车', '王某驾驶摩托车非法载客', '叶某超速行驶', '王某不按信号灯指示行驶', 'BC', '注意看题目，不是道路而是弯道，弯道的限速每小时/30以上，就算超速了。');
INSERT INTO `paper6` VALUES ('257', '单选题', '驾驶机动车进入高速公路隧道前需要注意什么？', '开启远光灯行驶', '开启示宽灯、尾灯行驶', '开启近光灯行驶', '到达隧道口时鸣喇叭', 'C', '进入隧道时相当于夜间行驶了，因此要开启近光灯。');
INSERT INTO `paper6` VALUES ('271', '单选题', '机动车停车的错误做法是什么？', '应当在规定地点停放', '禁止在人行道上停放', '在道路上临时停车时，不得妨碍其他机动车和行人通行', '可以停放在非机动车道上', 'D', '注意本题考的是错误的做法，机动车不能停放在非机动车道上。');
INSERT INTO `paper6` VALUES ('274', '单选题', '机动车在夜间通过没有交通信号灯控制的交叉路口时，要怎样使用灯光？', '使用远光灯', '使用近光灯', '使用危险报警闪光灯', '使用危险报警闪光灯', 'D', '《道路交通安全法实施条例》第五十九条：机动车在夜间通过急弯、坡路、拱桥、人行横道或者没有交通信号灯控制的路口时，应当交替使用远近光灯示意。');
INSERT INTO `paper6` VALUES ('277', '单选题', ' 驾驶机动车从高速公路加速车道汇入行车道车流时，以下做法正确的是什么?', '从正常行驶车辆后驶入行车道', '从正常行驶车辆前驶入行车道', '停车等待正常行驶车辆通过', '加速直接驶入行车道', 'A', '加速车道指的是供车辆驶入高速车流之前加速用的车道。从正常行驶车辆后驶入行车道。');
INSERT INTO `paper6` VALUES ('279', '单选题', '关于驾驶机动车汇入主路车流，以下说法正确的是什么?', '不得妨碍主路车辆正常行驶', '不得妨碍主路车辆正常行驶', '可以碾压实线及导流线', '不得妨碍主路车辆正常行驶。', 'A', '不得妨碍主路车辆正常行驶。');
INSERT INTO `paper6` VALUES ('282', '单选题', '夜间会车时，如遇对方持续开启远光灯，应当如何安全会车?', '鸣喇叭，加速通过', '及时开启远光灯', '使用近光灯，低速会车或停车让行', '使用远光灯，低速会车', 'C', '夜间安全驾驶知识中第三条就有:“夜间会车应当在距对方来车150米以外改用近光灯，若对方车辆不关闭远光灯，可连续变换灯光提示对向车辆。当遇对面来车仍不关闭远光灯时，应及时减速靠右侧行驶或停车让行。”');
INSERT INTO `paper6` VALUES ('289', '单选题', '超车过程中，被超车辆突然加速怎么办？', '加速迅速超越', '加速迅速超越', '持续鸣喇叭超越', '持续鸣喇叭超越', 'C', '超车过程中，被超车辆突然加速，应该减速放弃超车，否则容易引发事故。');
INSERT INTO `paper6` VALUES ('292', '判断题', '浓雾中行车听到对方车辆鸣喇叭时，只要在视野中看不到，可不去理会', '', '', '', '', 'B', '雾天行车听到对方鸣喇叭，也应该鸣喇叭回应，已提示对方车辆。');
INSERT INTO `paper6` VALUES ('293', '判断题', ' 驾驶机动车在高速公路上行驶，能见度小于50米时，只要车速不超过20公里/小时，可以不驶离高速公路。', '', '', '', '', 'B', '在高速公路上，能见度小于50米时，开启雾灯、近光灯、示廓灯、前后位灯和危险报警闪光灯，车速不得超过每小时20公里，并从最近的出口尽快驶离高速公路。');
INSERT INTO `paper6` VALUES ('300', '判断题', '为防止有害气体中毒伤员继续中毒，首先将伤员转移到空气新鲜的地方。', '', '', '', '', 'A', '中毒伤员所处的空间肯定空气不流通，空气新鲜的地方可以让人体的呼吸管道起畅通的作用。因此应当先转移位置到空气新鲜的地方。因此本题正确。');
INSERT INTO `paper6` VALUES ('309', '判断题', '驾驶有ABS系统的机动车在紧急制动的同时转向可能会发生侧滑。', '', '', '', '', 'A', 'ABS使汽车在紧急刹车时车轮不会抱死，这样就能使汽车在紧急制动时仍能保持较好的方向稳定性。由于四轮防抱死制动系统保留着控制转向的能力，因此，在制动过程中有可能绕过障碍物，避免可能发生的事故。然而，驾驶有ABS系统的机动车在紧急制动的同时转向会发生侧滑。');
INSERT INTO `paper6` VALUES ('311', '判断题', '安全头枕要调整到与颈部平齐的高度', '', '', '', '', 'B', '如果后方有车辆撞击，头部由于惯性会后冲，没有头枕保护，颈椎有可能折断。所以头枕的中心一定要与头齐平。');
INSERT INTO `paper6` VALUES ('313', '判断题', '驾驶汽车在非禁鸣路段，遇复杂交通情况时可合理使用喇叭。', '', '', '', '', 'A', '驾驶汽车在非禁鸣路段，遇复杂交通情况时可合理使用喇叭。');
INSERT INTO `paper6` VALUES ('316', '判断题', '预计在超车过程中与对面来车有会车可能时，应提前加速超越。', '', '', '', '', 'B', '预计在超车过程中与对面来车有会车可能时，应当放弃超车。若加速超越，有可能会引起不必要的事故。');
INSERT INTO `paper6` VALUES ('319', '判断题', '驾驶人下车前要观察后视镜和侧头观察左后侧情况。', '', '', '', '', 'A', '侧头观看左后侧情况是防止在开车门时，撞到非机动车驾驶人。在确定左后方无人经过，再开车门！侧头是把头转动一下，看看左后视镜，并不是把头探出车外。因此本题正确。');
INSERT INTO `paper6` VALUES ('322', '判断题', '机动车不得在隧道中倒车。', '', '', '', '', 'A', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。因此本题正确。');
INSERT INTO `paper6` VALUES ('323', '判断题', '夜间驾驶机动车在照明条件良好的路段可以不使用灯光', '', '', '', '', 'B', '用近光灯不会照得对方看不见路，同时为了安全起见，开启近光灯能够让相互间清晰可见。因此本题错误。');
INSERT INTO `paper6` VALUES ('325', '判断题', '在道路上跟车行驶时，跟车距离不是主要的，只须保持与前车相等的速度，即可防止发生追尾事故。', '', '', '', '', 'B', '跟车距离很重要，不同的道路对跟车距离要求是不一样的。假设你跟前车的的速度相等，但是距离是1米，是不可能刹得住车的。');
INSERT INTO `paper6` VALUES ('326', '判断题', '在道路上行车时，安全跟车距离无需随着速度变化而变化。', '', '', '', '', 'B', '安全跟车距离【需要】随着速度变化而变化，车速越高，跟车的安全距离要随之增大，这样才能保证安全。因此本题错误。');
INSERT INTO `paper6` VALUES ('329', '判断题', '驾驶汽车通过连续弯道时，尽量靠弯道右侧行驶。', '', '', '', '', 'A', '驾驶汽车通过连续弯道时，尽量靠弯道右侧行驶。');
INSERT INTO `paper6` VALUES ('332', '多选题', ' 驾驶机动车通过学校门口时应注意什么?', '注意观察标志标线', '注意减速慢行', '不要鸣喇叭', '快速通过', 'ABC', '车辆通过学校和小区应注葱观察标志标线.低速行驶，不要鸣喇叭，减少噪音，以免影响学生学习。');
INSERT INTO `paper6` VALUES ('338', '多选题', '驾驶汽车超速行驶有哪些危害？', '反应距离延长', '视野变窄', '加重事故后果', '制动距离延长', 'ABCD', 'A车速快，反应距离延长；B车速快2边的事物会比较模糊，视野就会窄；C车速快，由于惯性，碰撞引起的后果就严重；D车速快，制动距离自然延长。');
INSERT INTO `paper7` VALUES ('001', '单选题', '驾驶机动车在山区道路因故障停车需要注意什么？', '选择下坡路段停放', '选择上坡路段停放', '选择平缓路段停放', '选择坡顶位置停放', 'C', '停车时要尽可能选择安全的地点停车，而不管是上坡路、下坡路或是坡顶都有可能让所停车辆发生溜车。');
INSERT INTO `paper7` VALUES ('002', '单选题', '在冰雪路面制动时，发现车辆偏离方向，以下说法正确的是？', '连续轻踩轻放刹车', '用力踩刹车', '停止踩刹车', '以上说法都不对', 'C', '这个情况下，立即踏制动踏板容易引起侧翻。如后轮一直被刹住的情况下，不松开踏板，汽车会出现方向驶去控制。正确的做法是先握紧方向盘，不要紧急踩刹车。');
INSERT INTO `paper7` VALUES ('006', '单选题', '检查机动车机油时，以下做法正确是什么?', '停在平坦的地方，在启动前检查', '停在平坦的地方，在怠速状态下检查', '无需停在平坦的地方，在启动前检查', '无需停在平坦的地方，在怠速状态下检查', 'A', '对的检查的方式是需要注意检查的条件.千万不要在汽车发动的时候去检查。检查的时候要把车先停好，然后拉紧手刹，再取出机油尺，先族干净后放进去，然后再重新拿出来检查机油油位。如果在机油尺下端的标记之间.就表示了油且是正常的。如果在标记下面，就表示机油留太少。机油太多的话就会出现在机油最在标记上面。如果少了就需要适里添加机油。');
INSERT INTO `paper7` VALUES ('011', '单选题', '某日早上6时，冉某驾驶一辆大客车出发，连续行驶至上午11时，在宣汉县境内宣南路1公里处，坠于公路一侧垂直高度8.5米的陡坎下，造成13人死亡、9人受伤。冉某的主要违法行为是什么？', '超速行驶', '不按交通标线行驶', '客车超员', '疲劳驾驶', 'D', '规定：连续4小时就要停车休息20分钟！本题连续驾驶5小时，属于疲劳驾驶。');
INSERT INTO `paper7` VALUES ('013', '单选题', '出车前对轮胎进行哪些方面的检查？', '什么也不用检查', '轮胎有没有清洗', '备胎在什么位置', '轮胎的紧固和气压', 'D', '对轮胎的检查是为了确保在行车过程中能安全行驶，由此本题应选“轮胎的紧固和气压”。');
INSERT INTO `paper7` VALUES ('031', '判断题', '驾驶机动车驶出环岛时，应先驶入最右侧车道不用开启转向灯驶离即可。', '', '', '', '', 'B', '驶出环岛，需要先开启右转向灯。');
INSERT INTO `paper7` VALUES ('033', '判断题', '下坡路制动失效后，在不得已的情况下，可用车身侧面擦撞山坡，迫使机动车减速停车。', '', '', '', '', 'A', '刹车突然失灵时，摩擦力特别能显神奇功效。可用车前保险杠、车厢等钢性部位与路边岩石、大树或土坡摩擦、碰撞，在不威胁乘车人安全的情况下强行停车。这样，虽对车会造成损害，但是命更重要，就别心疼车了。因此本题正确。');
INSERT INTO `paper7` VALUES ('041', '判断题', '变更车道前确认后方无来车时可以不开转向灯变道。', '', '', '', '', 'B', '变更车道时要提前开启转向灯，养成良好的开车习惯，防患于未然，因此本题错误。');
INSERT INTO `paper7` VALUES ('050', '判断题', '驾驶机动车汇入车流时不能影响其他机动车通行。', '', '', '', '', 'A', '汇入车流的前提是不能影响其他车辆的正常通行，因此本题正确。');
INSERT INTO `paper7` VALUES ('053', '判断题', '机动车通过急转弯路段时，在机动车较少的情况下可以超车。', '', '', '', '', 'B', '《道路交通安全法》第四十三条：同车道行驶的机动车，后车应当与前车保持足以采取紧急制动措施的安全距离。有下列情形之一的，不得超车：（四）行经铁路道口、交叉路口、窄桥、弯道、陡坡、隧道、人行横道、市区交通流量大的路段等没有超车条件的。通过隧道，铁路道口，急转弯路段，窄路，窄桥或遇前方道路上有车辆掉头时，不得超车。');
INSERT INTO `paper7` VALUES ('061', '判断题', '在道路上跟车行驶时，跟车距离不是主要的，只须保持与前车相等的速度，即可防止发生追尾事故。', '', '', '', '', 'B', '跟车距离很重要，不同的道路对跟车距离要求是不一样的。假设你跟前车的的速度相等，但是距离是1米，是不可能刹得住车的。');
INSERT INTO `paper7` VALUES ('063', '判断题', '行车中变更车道不需要提前开启转向灯', '', '', '', '', 'B', '变更车道一定要【提前】开启转向灯。');
INSERT INTO `paper7` VALUES ('072', '多选题', '行车中驾驶人接打手机或发短信有什么危害？', '影响乘车人休息', '分散驾驶注意力', '影响正常驾驶操作', '遇紧急情况反应不及', 'BCD', '行车中危害有：1、会分散驾驶注意力；2、影响正常驾驶操作；3、遇紧急情况反应不及时。');
INSERT INTO `paper7` VALUES ('075', '多选题', '叶某驾驶中型厢式货车，行至陂头镇上汶线3公里加600米弯道路段时，以40公里/小时的速度与王某驾驶的乘载19人正三轮载货摩托车发生正面相撞，造成10人死亡、9人受伤。双方驾驶人的主要违法行为是什么', '叶某驾驶与准驾车型不符的机动车', '王某驾驶摩托车非法载客', '叶某超速行驶', '王某不按信号灯指示行驶', 'BC', '注意看题目，不是道路而是弯道，弯道的限速每小时/30以上，就算超速了。');
INSERT INTO `paper7` VALUES ('092', '多选题', '唐某驾驶一辆大客车，乘载74人（核载30人），以每小时38公里的速度，行至一连续下陡坡转弯路段时，机动车翻入路侧溪水内，造成17人死亡、57人受伤。唐某的主要违法行为是什么？', '酒后驾驶', '客车超员', '疲劳驾驶', '超速行驶', 'BD', '违法行为：1、乘载74人(核载30人)所以客车超员。2、弯道限速30公里/每小时，所以超速行驶。');
INSERT INTO `paper7` VALUES ('102', '单选题', '驾驶机动车遇到这种情况怎样行驶最安全？', '减速或停车让行', '紧靠路中心行驶', '保持正常车速', '占对向车道会车', 'A', '前方黑色车是在逆行，为了安全起见，减速或停车让行，惹不起，躲总可以了吧。');
INSERT INTO `paper7` VALUES ('114', '单选题', '驾驶机动车进入高速公路隧道前需要注意什么？', '开启远光灯行驶', '开启示宽灯、尾灯行驶', '开启近光灯行驶', '到达隧道口时鸣喇叭', 'C', '进入隧道时相当于夜间行驶了，因此要开启近光灯。');
INSERT INTO `paper7` VALUES ('116', '单选题', ' 如图所示，驾驶机动车遇到这种主路左侧来车的情况，以下说法正确的是什么？', '左侧来车应该给己车让行', '己车应该给左侧来车让行', '不需让行，谁车速快谁先过', '不需让行，己车有优先通行权', 'B', '图中路考为辅路近主路，此时己车应该给左侧来车让行。');
INSERT INTO `paper7` VALUES ('118', '单选题', ' 驾驶人进入驾驶室前，首先要做什么？', '观察机动车周围情况', '不用观察周围情况', '开启车门直接上车', '注意观察天气情况', 'A', '注意“进入驾驶室前”，也就是上车前，因此本题选“观察机动车周围情况”。');
INSERT INTO `paper7` VALUES ('120', '单选题', '使用已有裂纹或损伤的轮胎容易引起什么后果？', '向一侧偏驶', '爆胎', '转向困难', '行驶阻力增大', 'B', '使用已有裂纹或损伤的轮胎容易引起“爆胎”的后果。');
INSERT INTO `paper7` VALUES ('142', '单选题', '驾驶机动车遇到前方车辆停车，等待行人通过人行横道时，以下做法正确的是什么？', '从左侧超越前车', '鸣喇叭催促前车向前行驶', '从右侧超越前车', '与前车保持安全距离,排队等待', 'D', '前车等待行人过道时，自己也应耐心等待，B做法不恰当，AC做法易引发交通事故。');
INSERT INTO `paper7` VALUES ('144', '单选题', '在山区道路行驶时，以下说法正确的是什么？', '上坡路段的安全距离应比平坦路段的大', '急弯路段应当紧随前车', '下坡路段的安全距离应比平坦路段的小', '下坡路段的安全距离应比平坦路段的小', 'A', '上坡路段的安全距离应比平坦路段的大。上坡需要加速，为了避免和前车发生追尾，需要加大安全距离。');
INSERT INTO `paper7` VALUES ('151', '判断题', '机动车可以选择交叉路口进行倒车。', '', '', '', '', 'B', '《道路交通安全法实施条例》第五十条：机动车倒车时，应当察明车后情况，确认安全后倒车。不得在铁路道口、交叉路口、单行路、桥梁、急弯、陡坡或者隧道中倒车。');
INSERT INTO `paper7` VALUES ('156', '判断题', ' 驾驶机动车遇到骑自行车人占道影响通行时，可连续鸣喇叭加速从其左侧绕行。', '', '', '', '', 'B', '遇到这种情况应当减速慢行，必要时避让。因此本题错误。');
INSERT INTO `paper7` VALUES ('161', '判断题', '同方向有三条机动车道的路段，校车在右侧车道停靠上、下学生时，校车停靠车道后方和相邻机动车道上的机动车应停车等待。', '', '', '', '', 'A', '根据规定，校车在同方向只有一条机动车道的道路上停靠时，后方车辆应当停车等待，不得超越。校车在同方向有两条以上机动车道的道路上停靠时，校车停靠车道后方和相邻机动车道上的机动车应当停车等待，其他机动车道上的机动车应当减速通过。');
INSERT INTO `paper7` VALUES ('169', '判断题', '驾驶汽车在雨天起步前要使用刮水器', '', '', '', '', 'A', '驾驶汽车在雨天起步前要使用刮水器，增加视线区域。');
INSERT INTO `paper7` VALUES ('174', '判断题', '机动车通过急转弯路段时，在机动车较少的情况下可以超车。', '', '', '', '', 'B', '《道路交通安全法》第四十三条：同车道行驶的机动车，后车应当与前车保持足以采取紧急制动措施的安全距离。有下列情形之一的，不得超车：（四）行经铁路道口、交叉路口、窄桥、弯道、陡坡、隧道、人行横道、市区交通流量大的路段等没有超车条件的。通过隧道，铁路道口，急转弯路段，窄路，窄桥或遇前方道路上有车辆掉头时，不得超车。');
INSERT INTO `paper7` VALUES ('180', '判断题', '夜间驾驶机动车在照明条件良好的路段可以不使用灯光', '', '', '', '', 'B', '用近光灯不会照得对方看不见路，同时为了安全起见，开启近光灯能够让相互间清晰可见。因此本题错误。');
INSERT INTO `paper7` VALUES ('181', '判断题', '在行驶中，驾驶人在注意与前车保持安全距离的同时，也要谨慎制动，防止被后车追尾。', '', '', '', '', 'A', '在行驶过程中要留意与前后车的距离，因此若是贸然使用制动，很容易使后车来不及反应发生追尾，所以本题正确。');
INSERT INTO `paper7` VALUES ('186', '判断题', '驾驶汽车通过连续弯道时，尽量靠弯道右侧行驶。', '', '', '', '', 'A', '驾驶汽车通过连续弯道时，尽量靠弯道右侧行驶。');
INSERT INTO `paper7` VALUES ('200', '多选题', ' 吴某驾驶一辆大客车，乘载33人（核载22人），行至163县道7公里加300米处时，机动车失控坠入山沟，造成10人死亡、21人受伤。事后经酒精检测，吴某血液酒精含量为26毫克/百毫升。吴某的主要违法行为是什么？', '超速行驶', '客车超员', '疲劳驾驶', '酒后驾驶', 'BD', '违法行为：1、乘载33人(核载22人)，所以客车超员；2、吴某血液酒精含量为26毫克/百毫升，所以酒后驾驶。（此处既然检测到酒精就算酒后驾驶，不然人的血液里边哪里会有酒精）');
INSERT INTO `paper7` VALUES ('205', '多选题', '杨某驾驶改装小型客车（核载9人，实载64人，其中62人为幼儿园学生），行至榆林子镇马槽沟村处，占用对向车道逆行时与一辆重型自卸货车正面碰撞，造成22人死亡、44人受伤。该起事故中的主要违法行为是什么？', '货车超速行驶', '非法改装机动车', '客车超员', '客车逆向行驶', 'BCD', '违法行为：1、改装小型客车，所以非法改装机动车；2、核载9人，实载64人，所以客车超员；3、占用对向车道逆行时，所以客车逆向行驶。');
INSERT INTO `paper7` VALUES ('254', '单选题', '驾驶机动车遇到这样的情景怎样行驶？', '连续鸣喇叭', '快速通过', '减速慢行', '从一侧绕行', 'C', '遇到这样的情况要减速慢行，必要时停车避让，以免孩子们突然跑动被撞伤。');
INSERT INTO `paper7` VALUES ('259', '单选题', ' 如图所示，驾驶机动车遇到这种主路左侧来车的情况，以下说法正确的是什么？', '左侧来车应该给己车让行', '己车应该给左侧来车让行', '不需让行，谁车速快谁先过', '不需让行，己车有优先通行权', 'B', '图中路考为辅路近主路，此时己车应该给左侧来车让行。');
INSERT INTO `paper7` VALUES ('265', '单选题', '怎样调整汽车座椅安全头枕的高度？', '调整到头枕中心对正颈部', '调整到头枕中心与颈部平齐', '调整到头枕中心高出头顶', '调整到头枕中心能支撑头部', 'D', '安全头枕是保护颈部不受伤害的，能支撑头部才能保护颈部。会车中道路一侧有障碍，双方机动车应如何做？所以本题选择“调整到头枕中心能支撑头部”。');
INSERT INTO `paper7` VALUES ('266', '单选题', '会车中道路一侧有障碍，双方机动车应如何做？', '无障碍一方让对向先行', '速度慢的让速度快的先行', '有障碍的一方让对向先行', '速度快的让速度慢的先行', 'C', '有障碍的让无障碍的一方先行；但有障碍的一方已经驶入有障碍路段而无障碍一方未驶入的，有障碍的一方先行。');
INSERT INTO `paper7` VALUES ('277', '单选题', ' 驾驶机动车从高速公路加速车道汇入行车道车流时，以下做法正确的是什么?', '从正常行驶车辆后驶入行车道', '从正常行驶车辆前驶入行车道', '停车等待正常行驶车辆通过', '加速直接驶入行车道', 'A', '加速车道指的是供车辆驶入高速车流之前加速用的车道。从正常行驶车辆后驶入行车道。');
INSERT INTO `paper7` VALUES ('278', '单选题', ' 驾驶机动车应当怎样汇入主路车流?', '加速直接汇入车流', '开启转向灯观察主路情况确保安全汇入车流', '开启转向灯直接汇入车流', '开启转向灯直接汇入车流', 'B', '开启转向灯观察主路情况确保安全汇入车流。');
INSERT INTO `paper7` VALUES ('281', '单选题', '驾驶机动车在山区道路行驶时，以下说法正确的是什么？', '上坡路段的安全距离应比平坦路段的大', '下坡路段的安全距离应比平坦路段的小', '急弯路段应当紧随前车', '急弯路段可以超车', 'A', '上坡路段的安全距离应比平坦路段的大。上坡需要加速，为了避免和前车发生追尾，需要加大安全距离。');
INSERT INTO `paper7` VALUES ('293', '判断题', ' 驾驶机动车在高速公路上行驶，能见度小于50米时，只要车速不超过20公里/小时，可以不驶离高速公路。', '', '', '', '', 'B', '在高速公路上，能见度小于50米时，开启雾灯、近光灯、示廓灯、前后位灯和危险报警闪光灯，车速不得超过每小时20公里，并从最近的出口尽快驶离高速公路。');
INSERT INTO `paper7` VALUES ('297', '判断题', '下坡路制动失效后，在不得已的情况下，可用车身侧面擦撞山坡，迫使机动车减速停车。', '', '', '', '', 'A', '刹车突然失灵时，摩擦力特别能显神奇功效。可用车前保险杠、车厢等钢性部位与路边岩石、大树或土坡摩擦、碰撞，在不威胁乘车人安全的情况下强行停车。这样，虽对车会造成损害，但是命更重要，就别心疼车了。因此本题正确。');
INSERT INTO `paper7` VALUES ('301', '判断题', '在高速公路上，遇尾随较近行驶的机动车时，可以选择时机迅速从中间插入。', '', '', '', '', 'B', '这种情况下若是从中间插入，很有可能与前后车辆发生擦碰或是追尾，因此不可行。所以本题错误。');
INSERT INTO `paper7` VALUES ('304', '判断题', '同方向有三条机动车道的路段，校车在右侧车道停靠上、下学生时，校车停靠车道后方和相邻机动车道上的机动车应停车等待。', '', '', '', '', 'A', '根据规定，校车在同方向只有一条机动车道的道路上停靠时，后方车辆应当停车等待，不得超越。校车在同方向有两条以上机动车道的道路上停靠时，校车停靠车道后方和相邻机动车道上的机动车应当停车等待，其他机动车道上的机动车应当减速通过。');
INSERT INTO `paper7` VALUES ('305', '判断题', '变更车道前确认后方无来车时可以不开转向灯变道。', '', '', '', '', 'B', '变更车道时要提前开启转向灯，养成良好的开车习惯，防患于未然，因此本题错误。');
INSERT INTO `paper7` VALUES ('306', '判断题', '出车前检查冷却液、发动机机油、燃油等是否有渗漏现象。', '', '', '', '', 'A', '确保出行前一定都OK。');
INSERT INTO `paper7` VALUES ('309', '判断题', '驾驶有ABS系统的机动车在紧急制动的同时转向可能会发生侧滑。', '', '', '', '', 'A', 'ABS使汽车在紧急刹车时车轮不会抱死，这样就能使汽车在紧急制动时仍能保持较好的方向稳定性。由于四轮防抱死制动系统保留着控制转向的能力，因此，在制动过程中有可能绕过障碍物，避免可能发生的事故。然而，驾驶有ABS系统的机动车在紧急制动的同时转向会发生侧滑。');
INSERT INTO `paper7` VALUES ('317', '判断题', '机动车通过急转弯路段时，在机动车较少的情况下可以超车。', '', '', '', '', 'B', '《道路交通安全法》第四十三条：同车道行驶的机动车，后车应当与前车保持足以采取紧急制动措施的安全距离。有下列情形之一的，不得超车：（四）行经铁路道口、交叉路口、窄桥、弯道、陡坡、隧道、人行横道、市区交通流量大的路段等没有超车条件的。通过隧道，铁路道口，急转弯路段，窄路，窄桥或遇前方道路上有车辆掉头时，不得超车。');
INSERT INTO `paper7` VALUES ('319', '判断题', '驾驶人下车前要观察后视镜和侧头观察左后侧情况。', '', '', '', '', 'A', '侧头观看左后侧情况是防止在开车门时，撞到非机动车驾驶人。在确定左后方无人经过，再开车门！侧头是把头转动一下，看看左后视镜，并不是把头探出车外。因此本题正确。');
INSERT INTO `paper7` VALUES ('323', '判断题', '夜间驾驶机动车在照明条件良好的路段可以不使用灯光', '', '', '', '', 'B', '用近光灯不会照得对方看不见路，同时为了安全起见，开启近光灯能够让相互间清晰可见。因此本题错误。');
INSERT INTO `paper7` VALUES ('324', '判断题', '在行驶中，驾驶人在注意与前车保持安全距离的同时，也要谨慎制动，防止被后车追尾。', '', '', '', '', 'A', '在行驶过程中要留意与前后车的距离，因此若是贸然使用制动，很容易使后车来不及反应发生追尾，所以本题正确。');
